Siguen inmortales en 
RD , Republica Dominicana . 🇩🇴🇩🇴🇩🇴

Baile y género musical Dembow Dominicano.

Playero y The Noise Fueron pieza clave para crear en Baile y el género Dembow Dominicano. 
He visto varios videos Dembow Dominicano con la canción (Liza Love) . Este video es de Ayer . 2023 gracias RD 🇩🇴🇩🇴🇩🇴 y aún sigue sonando en varios países más . 

Por eso La revista Rolling Stone hace poco colocó en #68 en Reggaeton de todos los tiempos el tema (Liza Love) 
Gracias tamo activo . 

